import React from "react";
import './Movies.css';
import { useState, useEffect } from "react";


function Bookingpage() {
    const [date, setDate] = useState(new Date());
  
    useEffect(() => {
      const timer = setInterval(() => {
        setDate(new Date());
      }, 1000);
  
      return () => {
        clearInterval(timer);
      };
    }, []);
  
    return (
      <div>
        <h1>{date.toLocaleString()}</h1>
      </div>
    );
  }
